var handlers = {
    'LaunchRequest': function () {
        this.emit('GetFact');
    },
    'GetNewFactIntent': function () {
        this.emit('GetFact');
    },
    'GetFact': function () {
        var what_im_doing = this;
        function getRandomInt(min, max) {
          min = Math.ceil(min);
          max = Math.floor(max);
          return Math.floor(Math.random() * (max - min)) + min;
        }

        var gene_id = gene_ids[getRandomInt(0,gene_ids.length - 1)];

        var url = "http://rest.genenames.org/fetch/hgnc_id/" + gene_id;
        var options = {
          url: url,
          headers: {
            'Accept': 'application/json'
          }
        };

        var the_info = "";
        var the_gene = "";
        var chrom_loc = "";
        request(options, function (error, response, body) {
          if (!error && response.statusCode == 200) {
              var info = JSON.parse(body);
              try {
                  var the_data = info.response.docs[0];
                  the_info = the_data.name;
                  the_gene = the_data.symbol;
                  chrom_loc = the_data.location;
              } catch (ex) {
                  the_info = "B-Raf proto-oncogene, serine/threonine kinase";
                  the_gene = "BRAF";
                  chrom_loc = "7q34";
              }

              var speechOutput = 'Here is your gene fact. The gene I have selected is abbreviated as <say-as interpret-as="spell-out">' +
              the_gene.split('').join('<break time="100ms"/>') + '<break time="100ms"/></say-as>, and its official name is ' + the_info + '. This gene is located on chromosome ' + chrom_loc + '.';
              what_im_doing.emit(':tellWithCard', speechOutput, SKILL_NAME, the_info);
          }
        });
    },
    'AMAZON.HelpIntent': function () {
        var speechOutput = "You can say tell me a gene fact, or, you can say exit... What can I help you with?";
        var reprompt = "What can I help you with?";
        this.emit(':ask', speechOutput, reprompt);
    },
    'AMAZON.CancelIntent': function () {
        this.emit(':tell', 'Goodbye!');
    },
    'AMAZON.StopIntent': function () {
        this.emit(':tell', 'Goodbye!');
    }
};
